window.bookSummaryJSON = "<p><b>Alex Verus faces his dark side in this return to the best-selling urban fantasy series about a London-based mage.&nbsp;</b></p> <p>To protect his friends, Mage Alex Verus has had to change - and embrace his dark side. But the life mage Anne has changed too, and made a bond with a dangerous power. She's going after everyone she's got a grudge against - and it's a long list.&nbsp;</p> <p>In the meantime, Alex has to deal with his arch-enemy, Levistus. The Council's death squads are hunting Alex as well as Anne, and the only way for Alex to stop them is to end his long war with Levistus and the Council, by whatever means necessary. It will take everything Alex has to stay a step ahead of the Council and stop Anne from letting the world burn.</p>"; 
